import axios from 'axios';
import React from 'react';
import AppBar1 from '../../AppBar1'
import './Reports.css';
import { useNavigate } from 'react-router-dom';


export default function Reports() {
    const [report, setReport] = React.useState(null);
    React.useEffect(()=>{
        async function getData() {
            const res = await axios.get("http://localhost:8080/api/consultation/consul001"); /*axios to handle HTTP requests*/
            setReport(res.data);
        }
        getData();
    },[])

    const Navigate=useNavigate();
    const back = () =>{
        
    }
  return (
    <div>
    <AppBar1 />
        <div class="report">
            <h1>Report</h1>
            <h3>Consultation Number</h3>
            {report && 
                <p><i>
                {report.consultation_number}
                </i>
                </p>
            }
            <h3>Presenting Complaint</h3>
            {report && 
                <p>
                {report.Presenting_Complaint}
                </p>
            }
            <h3>History Of Presenting Complaint</h3>
            {report && 
                <p>
                {report.History_PC}
                </p>
            }
            <h3>Past Medical History</h3>
            {report && 
                <p>
                {report.Pm_History}
                </p>
            }
            <h3>Past Surgeries</h3>
            {report && 
                <p>
                {report.Past_surgeries}
                </p>
            }
        </div>
        <Button variant="contained" color="success" sx={{ml:7 ,mb:5}} onClick={back}>
            Submit
          </Button>
    </div>
  )
}
